import React from "react";
import {HospitalEntry} from "../types";

const HospitalDisplay: React.FC<{entry:HospitalEntry}>=({entry})=>{
    return(
        <section>
            <h3>{entry.date}, {entry.type}</h3>
            <p>{entry.description}</p>

        </section>
    )
}
export default HospitalDisplay;
